// @flow

import type { page } from './devtools/page';
import Chrome from './../chrome';

export type chromeDefaultConfig = {
  host: string;
  port: number;
  secure: boolean;
};

export type chromeOptionProperties = {
  host: string;
  port: number;
  secure: boolean;
  target: Function;
};

export type devToolsProtocolClient = {
  Protocol: Promise<{}>;
  List: Promise<{}>;
  New: Promise<{}>;
  Activate: Promise<{}>;
  Close: Promise<{}>;
  Version: Promise<{}>;

  /* domains */
  Page: page;

  DOM: any;
  DOMDebugger: any;
  Debugger: any;
  Emulation: any;
  Input: any;
  Network: any;
  Profiler: any;
  Runtime: any;
  Schema: any;

  close(): void;
}

export type chrome = {
  option: chromeOptionProperties;
  client: devToolsProtocolClient;

  /* methods */
  constructor(option?: Object): void;
  connectDevToolsProtocolClient(): Promise<Chrome>;
  fetchProtocol(): Promise<devToolsProtocolClient>;
  terminate(): Promise<Chrome>;
};

// @flow
// from: https://chromedevtools.github.io/devtools-protocol/1-2/Network/

import type { frameId, ResourceType } from './page';
import type { StackTrace } from './runtime';

export type LoaderId = string;
export type Headers = Object;
export type RequestId = String;
export type ConnectionType = "none" | "cellular2g" | "cellular3g" | "cellular4g" | "bluetooth" | "ethernet" | "wifi" | "wimax" | "other."
export type Timestamp = Number;

export type IntiatorType = "parser" | "script" | "other";
export type Initiator = {
  type: IntiatorType,
  stack?: StackTrace,
  url?: string,
  lineNumber?: Number
};

export type Response = {
};

export type network = {
  /* methods */
  enable(
    maxTotalBufferSize?: Number,
    maxResourceBufferSize?: Number
  ): Promise<{}>;
  disable(): Promise<{}>;
  setUserAgentOverride(userAgent: String): Promise<{}>;
  setExtraHTTPHeaders(headers: Headers): Promise<{}>;
  getResponseBody(requestId: RequestId): Promise<{}>;
  canClearBrowserCache(result: boolean): Promise<{}>;
  clearBrowserCache(): Promise<{}>;
  canClearBrowserCookies(result: boolean): Promise<{}>;
  emulateNetworkConditions(
    offline: boolean,
    latency: Number,
    downloadThroughput: Number,
    uploadThroughput: Number,
    connectionType: ConnectionType
  ): Promise<{}>;
  setCacheDisabled(cacheDisabled: boolean): Promise<{}>;

  /* Events */
  requestWillBeSent(
    requestId: RequestId,
    frameId: frameId,
    loaderId: LoaderId,
    timestamp: Timestamp,
    wallTime: Timestamp,
    initiator: Initiator,
    redirectResponse?: Response,
    type: ResourceType
  ): void;
  requestServedFromCache(requestId: RequestId): void;
  responseReceived(
    requestId: RequestId,
    frameId: frameId,
    loaderId: LoaderId,
    timestamp: Timestamp
  ): void
};

// @flow
// from: https://chromedevtools.github.io/devtools-protocol/1-2/Page/

import type { LoaderId } from './network';

export type ResourceType = String;
export type frameId = String;
export type frame = {
  id: string,
  parentId?: string,
  loaderId: LoaderId,
  name?: String,
  securityOrigin: String,
  mimeType: String,
};

export type page = {
  /* methods */
  enable(): Promise<{}>;
  disable(): Promise<{}>;
  reload(opt?: {
    ignoreCache?: Boolean,
    scriptToEvaluateOnLoad?: String,
  }): Promise<{}>;
  navigate(url: String): frameId;
  handleJavaScriptDialog(accept: boolean, promptText?: String): Promise<{}>;

  /* events */
  domContentEventFierd(callback: Function): void;
  loadEventFired(callback: Function): void;
  frameAttached(frameId: frameId, parentFrameId: frameId): void;
  frameNavigated(frame: frame): void;
  frameDetached(frameId: frameId): void;
  javascriptDialogOpening(message: String, type: String): void;
  interstitialShown(callback: Function): void;
  interstitialHidden(callback: Function): void;
  navigationRequested(
    isInMainFrame: boolean,
    isRedirect: boolean,
    navigationId: Number,
    url: String
  ): void;
};

// @flow
// from: https://chromedevtools.github.io/devtools-protocol/1-2/Runtime/

export type CallFrame = {

};
export type StackTrace = {
  description?: string,
  CallFrames: Array<CallFrame>,
  parent?: StackTrace,
};

// @flow

export type launchConfig = {
  port: number,
  autoSelectChrome: boolean,
  additionalFlags: Array<string>
};

export type chromeLauncherType = {
    prepared: Boolean;
    pollInterval: number;
    autoSelectChrome: Boolean;
    TMP_PROFILE_DIR: string;
    outFile: number;
    errFile: number;
    pidFile: string;
    startingUrl: string;
    additionalFlags: Array<string>;
    chrome: any;
    port: number;
    constructor(opts?: launchConfig): void;
    flags(): void;
    prepare(): void;
    run(): Promise<{}>;
    spawn(execPath: string): Promise<any[]>;
    cleanup(client?: any): void;
    isDebuggerReady(): Promise<{}>;
    waitUntilReady(): Promise<{}>;
    kill(): Promise<{}>;
    destroyTmp(): Promise<{}>
}

export type launcher = {
  config: launchConfig;
  chromeLauncher: chromeLauncherType;

  constructor(config?: Object): void;
  isLaunched(): boolean;
  reboot(): Promise<{}>;
  terminate(): Promise<{}>;
  start(): Promise<{}>;
}

import Chaldeas from './chaldeas';

import Chrome, { defaultOption as chromeDefaultOption } from './chrome/chrome';
import Launcher, { defaultOption as launcherDefaultOption } from './chrome/launcher';

export {
  Chrome,
  chromeDefaultOption,
  Launcher,
  launcherDefaultOption,
};

export default Chaldeas;
